import Button from '../button';
import Field from '../formField';
import Select from '../formSelect';
import buttonImage from "../../assets/images/Summer/Ícones/pngs/local_activity.png";
import './form.css'
import { useState } from 'react';

function Form() {

  const [formData, setFormData] = useState({
    name: '',
    email: '',
    cpf: '',
    ticket: '',
    birthDate: ''
  }); 

  function showData(event) {
    event.preventDefault();
    setFormData({
      name: event.target.name.value,
      email: event.target.email.value,
      cpf: event.target.cpf.value,
      ticket: event.target.ticket.value,
      birthDate: event.target.birthDate.value
    });
    console.log(formData);
  }

  return (
    <div className="form__container">
        <h1 className="form__title">Preencha o formulário a seguir:</h1>
        <form className="form__body" method="post" action="#" > 
            <Field labelName={"Nome Completo:"} type={"text"} name={"name"} />            
            <Field labelName={"Email:"} type={"text"} name={"email"}/>
            <Field labelName={"CPF:"} type={"text"} name={"cpf"}/>
                <div className='form__last__line'>
                    <Select labelName={"Tipo de ingresso"} name={"ticket"}/>
                    <Field labelName={"Data de nascimento:"} type={"date"} name={"birthDate"}/>
                </div>
            <Button text={"Avançar!"} image={buttonImage}/>
        </form>
    </div>
  ) 
    
}

export default Form;
